import logo from './logo.svg';
import './App.css';

const serviceList = [
  'Internet',
  'Telewizja',
  'Abonament telefoniczny',
  'Dekoder 4K'
];

function App() {
  return (
    <div className="App">
      <div className="navbar">
        Kalkulator cen usług
      </div>

      <div className="service-selector">
        {serviceList.forEach(service => {
          (
            <p>{service}</p>
          )
        })}
      </div>

      <div className="footer">
        Bartosz Wiecheć
      </div>
    </div>
  );
}

export default App;
